// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import { FiBell, FiMessageSquare, FiSearch, FiActivity } from "react-icons/fi";
import { MdOutlineAccountBalanceWallet } from "react-icons/md";
import { HiOutlineDocumentCheck } from "react-icons/hi2";

const Navbar = () => {
  const { user, logout } = useAuth();

  const role = user?.role;

  const canSee = (roles = []) => user && (roles.length === 0 || roles.includes(role));

  return (
    <div className="navbar">
      <div className="navbar-inner">
        <div className="brand">
          <div className="brand-badge" />
          <Link to="/" style={{ fontWeight: 800 }}>AgroTrust</Link>
        </div>

        {/* MAIN LINKS */}
        <div className="nav-links">
          {user && (
            <>
              <Link className="nav-link" to="/">Home</Link>

              {/* Core */}
              <Link className="nav-link" to="/crops">Crops</Link>
              <Link className="nav-link" to="/education">Education</Link>
              <Link className="nav-link" to="/complaints">Complaints</Link>

              {/* Important additions */}
              <Link className="nav-link" to="/search">Search</Link>

              {canSee(["FARMER", "GOV_OFFICIAL", "ADMIN"]) && (
                <Link className="nav-link" to="/subsidies">Subsidies</Link>
              )}

              {canSee(["BUYER"]) && (
                <Link className="nav-link" to="/feedback">Feedback</Link>
              )}

              {canSee(["GOV_OFFICIAL"]) && (
                <Link className="nav-link" to="/gov">Gov Dashboard</Link>
              )}

              {canSee(["ADMIN"]) && (
                <>
                  <Link className="nav-link" to="/admin">Admin Panel</Link>
                  <Link className="nav-link" to="/analytics">Analytics</Link>
                  <Link className="nav-link" to="/verification">Verification</Link>
                  <Link className="nav-link" to="/ledger">Ledger</Link>
                </>
              )}
            </>
          )}
        </div>

        {/* RIGHT SIDE */}
        <div className="nav-right">
          {user ? (
            <>
              {/* quick action icons */}
              <div style={{ display: "flex", gap: 10, alignItems: "center" }}>
                <Link className="icon-btn" to="/notifications" title="Notifications">
                  <FiBell size={18} />
                </Link>
                <Link className="icon-btn" to="/chatbot" title="Chatbot">
                  <FiMessageSquare size={18} />
                </Link>
                <Link className="icon-btn" to="/search" title="Search">
                  <FiSearch size={18} />
                </Link>

                {canSee(["ADMIN", "GOV_OFFICIAL"]) && (
                  <Link className="icon-btn" to="/analytics" title="Analytics">
                    <FiActivity size={18} />
                  </Link>
                )}

                {canSee(["ADMIN"]) && (
                  <Link className="icon-btn" to="/ledger" title="Blockchain Ledger">
                    <MdOutlineAccountBalanceWallet size={18} />
                  </Link>
                )}

                {canSee(["ADMIN"]) && (
                  <Link className="icon-btn" to="/verification" title="Profile Verification">
                    <HiOutlineDocumentCheck size={18} />
                  </Link>
                )}
              </div>

              <span className="pill" style={{ marginLeft: 10 }}>
                {user.name} ({user.role})
              </span>

              <button className="btn btn-danger" onClick={logout}>
                Logout
              </button>
            </>
          ) : (
            <>
              <Link className="btn" to="/login">Login</Link>
              <Link className="btn btn-primary" to="/register">Register</Link>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
